DROP PROCEDURE IF EXISTS `pro_historydatadeal`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `pro_historydatadeal`(IN `p_probeid` int, IN `p_starttime` datetime, IN `p_endtime` datetime)
BEGIN
		#Routine body goes here...		
		#获取起始时间到结束时间中数据的最大时间和最小时间
		declare maxtime datetime;
		declare mintime datetime;		
		declare startdiff int;
		declare enddiff int;
		declare addtime datetime;
		declare millisecond bigint;
	  #声明个变量
		declare s_datetime datetime;
		declare lds float;
		declare rds int;
		declare rank float;
		declare time datetime;
		declare start_flag int;
		declare a int;
		#遍历数据结束标志
    DECLARE done INT DEFAULT FALSE;
		#定义一个游标，分析起始时间到结束时间之间的数据，判断每条数据的时间间隔
    #DECLARE cur_account CURSOR FOR select Time,LDS,RDS,AlertRank from hd_probe where ProbeID = p_probeid and Time >= p_starttime and Time <= p_endtime order by Time asc;
		DECLARE cur_account CURSOR FOR select Time,LDS,RDS,AlertRank from hd_probe where ProbeID = '3' and Time >= '2019-03-29 12:00:00' and Time <= '2019-04-02 23:00:00'  order by Time asc;
    #将结束标志绑定到游标
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;

		drop table if exists Tmp;
    #创建临时表#Tmp存储返回结果
		create TEMPORARY table Tmp 
		(
			time bigint,
			lds  float,
			rds float,
			rank int			
		);		
		select Time,LDS,RDS,AlertRank from hd_probe where ProbeID = '3' and Time >= '2019-03-29 12:00:00' and Time <= '2019-04-02 23:00:00' order by Time asc;
		#获取最大时间和最小时间
		#select MAX(hd_probe.Time), MIN(hd_probe.Time) INTO maxtime, mintime from hd_probe where ProbeID = p_probeid and Time >= p_starttime and Time <= p_endtime;
		select MAX(hd_probe.Time), MIN(hd_probe.Time) INTO maxtime, mintime from hd_probe where ProbeID = '3' and Time >= '2019-03-29 12:00:00' and Time <= '2019-04-02 23:00:00' ;
		set addtime = p_starttime;
		set startdiff = timestampadd(MINUTE, p_starttime, mintime);
		
		select p_probeid, p_starttime, p_endtime;
		select maxtime, mintime;		
		#select Time,LDS,RDS,AlertRank from hd_probe where ProbeID = p_probeid and Time >= p_starttime and Time <= p_endtime order by Time asc;
				
		#想缓存表添加空白时间段的数据（为null）
		while startdiff>30 do
			#select timestampdiff(SECOND,'1970/01/01 00:00:00',addtime) into millisecond;
			set millisecond= timestampdiff(year,'1970/01/01 00:00:00',addtime);
			set millisecond=millisecond*1000;
			set addtime=timestampadd(MINUTE,30,addtime);
			set startdiff=timestampdiff(MINUTE,addtime,mintime);
		end while;

		set start_flag=1;		
    #打开游标
    OPEN  cur_account;     
    #遍历
    read_loop: LOOP
				#取值 取多个字段
				FETCH  NEXT from cur_account INTO s_datetime,lds,rds,rank;
				IF done THEN
					LEAVE read_loop;
				END IF;
 
        #你自己想做的操作
        if start_flag=1 then
					set time=s_datetime;
					set start_flag=0;
					set millisecond=timestampdiff(SECOND,'1970/01/01 00:00:00',time);
					set millisecond=millisecond*1000;
				else
					set a= timestampdiff(MINUTE,time,s_datetime);
					while a>30 do
						set millisecond=timestampdiff(SECOND,'1970/01/01 00:00:00',time);
						set millisecond=millisecond*1000;
						set time=timestampadd(MINUTE,30,time);
						set a=timestampdiff(MINUTE,time,s_datetime);
					end while;
					set millisecond=timestampdiff(SECOND,'1970/01/01 00:00:00',s_datetime);
					set millisecond=millisecond*1000;
					set time=s_datetime;
				end if;
				#用游标去取下一条记录
				fetch next from cur_account into s_datetime,lds,rds,rank;
    END LOOP; 
    CLOSE cur_account;	 #关闭游标	
		
		set addtime=timestampadd(MINUTE,30,maxtime);
		set enddiff=timestampdiff(MINUTE,addtime,p_endtime);
		#想缓存表添加空白时间段的数据（为null）
		while enddiff>30 do
			set millisecond=timestampdiff(SECOND,'1970/01/01 00:00:00',addtime);
			set millisecond=millisecond*1000;
			set addtime=timestampadd(MINUTE,30,addtime);
			set enddiff=timestampdiff(MINUTE,addtime,p_endtime);
		end while;
		
		select * from Tmp;
END
;;
DELIMITER ;
